import React from 'react';
import PropTypes from 'prop-types';
import styled from 'styled-components';
import { motion } from 'framer-motion';

export function ProgressBar(props) {
	const Container = styled.div`
		position: relative;
		height: 100%;
		width: 100%;
		background-color: black;
		border-radius: 5px;

		h3 {
			position: absolute;
			z-index: 101;
			color: black;
			width: fit-content;
			white-space: nowrap;
			left: 100px;
		}
	`;

	const Point = styled(motion.div)`
		position: absolute;
		left: ${props.progressPercent};
		top: 50%;
		transform: translate(-50%, -50%);
		bottom: 10px;
		height: 100%;
		width: 8px;
		background-color: black;
		border-radius: 50%;
	`;
	const Progress = styled(motion.div)`
		position: absolute;
		left: 0;
		top: 0;
		bottom: 10px;
		height: inherit;
		width: ${props.progressPercent};
		background-color: whitesmoke;
		border-radius: 5px;

		h3 {
			position: absolute;
			width: fit-content;
			white-space:nowrap;
			left: 100px;
			color: white;
			z-index:100;
		}
	`;

	return (
		<Container>
			<h3>TRANSIENT BEING - TRACK 4 (DUB MIX)</h3>
			<Point animate={{ left: props.progressPercent }} />
			<Progress animate={{ width: props.progressPercent }}>
				<h3>TRANSIENT BEING - TRACK 4 (DUB MIX)</h3>
			</Progress>
		</Container>
	);
}

ProgressBar.propTypes = {
	progressPercent: PropTypes.string,
	width: PropTypes.string
};
